import React from 'react';
import './Home.css'

const Team = () => {
    return (
        <div>
            <div className="team-section">
                <div className="team-container">
                    <div className="row">
                        <div className="col-md-3"></div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Team;
